                    <p>Hi, I'm Siddharth, a passionate Front-end React Developer based in Mumbai</p>
                </section>
                <section className='main-image'>
                    <img height={200} width={180} src='https://o.remove.bg/downloads/8684381d-b92c-4480-873a-1144aa852665/siddharth_profile_pic-removebg-preview.png' />
                </section>
            </div>
        </>
    )
}

export default Hero
